function sum(a,b){
let c = a + b;
return c;
}
function sub(a,b){
let d = a - b;
return d;
}
function div(a,b){
let e = a / b;
e = e.toFixed(2);
return e;
}
function mul(a,b){
let f = a * b;
return f;
}
export {sum,sub,div,mul};
